import logo from './logo.svg';
import './App.css';
import Home from './Pages/Home';
import Menu from './Pages/Menu';
import TopicBox from './components/TopicBox';
import NewTopicBox from './components/NewTopicBox';
function App() {
  return (
    <div className="App">
      <Home/>  
      <Menu/>
      <Home/>  
      <Menu/>
      <Home/>  
      <TopicBox/>
      <Menu/>
      <NewTopicBox/>
    </div>
  );
}

export default App;
